import React from "react";
import styled from "styled-components";

const CartPage = () => {
  return <h4>cart page</h4>;
};

const Wrapper = styled.main`
  .empty {
    text-align: center;
    h2 {
      margin-bottom: 1rem;
      text-transform: none;
    }
  }
`;

export default CartPage;
